    print("current_index_action:", current_index_action)
    print("prev_index_action:", prev_index_action)
    add_action = set(current_index_action) - set(prev_index_action)
    drop_action = set(prev_index_action) - set(current_index_action)
    # build the indices
    time_start = time.time()
    for action in add_action:
        index_to_create = index.candidate_indices[action]
        # build index action
        print("create index")
        print(index_to_create)
        driver.buildIndex(index_to_create)
    for action in drop_action:
        index_to_drop = index.candidate_indices[action]
        # drop index action
        print("drop index")
        print(index_to_drop)
        driver.dropIndex(index_to_drop)
    time_end = time.time()
    idx_build_time += (time_end - time_start)
    current_micro_action = reform_micro_actions[t1 * micro_duration]
    for parameter_change_sql in current_micro_action:
        print(parameter_change_sql)
        driver.setSystemParameter(parameter_change_sql)
    run_time = driver.runQueriesWithoutTimeout()
    print("current micro runtime:", run_time)
    prev_index_action = current_index_action
    t1 += 1
